import styled from "styled-components";

export const filterButton = styled.div`
  border: 1px solid #d9d9d9;
  border-radius: 4px;
  width: 323px;
  height: 54px;
 background-color:white;
 display:flex;
 flex-direction:row;
 gap: 130px;
`;

export const p = styled.p`
cursor:auto;
`
